import React from 'react'
import Box from '@mui/material/Box'

function InputDisplay({type, value, name, options}) {
    return (
        <div>
            <Box sx={{mb:3}}>
                Name: {name} <br/>
                Type: {type} <br/>
                Value: {value}

                {options ?
                    <div>
                        Options:
                        {options.map(option => (
                            <div>- {option} <br/></div>
                        ))}
                    </div>
                : null}
            </Box>
        </div>
    )
}


export default InputDisplay
